import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
`;

const Online = ({ children }) => {
  return (
    <StyledOnline>
      <Header>

        <p style={{fontSize}}></p>
      </Header>
    </StyledOnline>
  );
};

export default Online;
